/* Model creation/destruction functions */

void MODEL_mkFlowTest2::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  mkFlowTest2_instance = new MOD_mkFlowTest2(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (mkFlowTest2_instance->INST_px.INST_p0_rv.set_clk_0)("CLK");
  (mkFlowTest2_instance->INST_px.INST_p1_rv.set_clk_0)("CLK");
  (mkFlowTest2_instance->INST_px.INST_p2_rv.set_clk_0)("CLK");
  (mkFlowTest2_instance->INST_px.INST_p3_rv.set_clk_0)("CLK");
  (mkFlowTest2_instance->INST_px.INST_p4_rv.set_clk_0)("CLK");
  (mkFlowTest2_instance->INST_px.INST_p5_rv.set_clk_0)("CLK");
  (mkFlowTest2_instance->INST_px.INST_p6_rv.set_clk_0)("CLK");
  (mkFlowTest2_instance->INST_px.INST_inQ.set_clk_0)("CLK");
  (mkFlowTest2_instance->INST_px.set_clk_0)("CLK");
  (mkFlowTest2_instance->set_clk_0)("CLK");
}
void MODEL_mkFlowTest2::destroy_model()
{
  delete mkFlowTest2_instance;
  mkFlowTest2_instance = NULL;
}
void MODEL_mkFlowTest2::reset_model(bool asserted)
{
  (mkFlowTest2_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkFlowTest2::get_instance()
{
  return mkFlowTest2_instance;
}

/* Fill in version numbers */
void MODEL_mkFlowTest2::get_version(char const **name, char const **build)
{
  *name = "2023.01";
  *build = "52adafa5";
}

/* Get the model creation time */
time_t MODEL_mkFlowTest2::get_creation_time()
{
  
  /* Mon May  8 13:35:47 UTC 2023 */
  return 1683552947llu;
}

/* State dumping function */
void MODEL_mkFlowTest2::dump_state()
{
  (mkFlowTest2_instance->dump_state)(0u);
}

/* VCD dumping functions */
MOD_mkFlowTest2 & mkFlowTest2_backing(tSimStateHdl simHdl)
{
  static MOD_mkFlowTest2 *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkFlowTest2(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkFlowTest2::dump_VCD_defs()
{
  (mkFlowTest2_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkFlowTest2::dump_VCD(tVCDDumpType dt)
{
  (mkFlowTest2_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkFlowTest2_backing(sim_hdl));
}
